import { useContext } from "react"
import { GallaryContaxt } from "./GarllaryProvider";

function Gallary() {
    const contaxt = useContext(GallaryContaxt)
    console.log(contaxt);
    return (
        <div>
            <div className="product">
                <h1>{contaxt.title}</h1>
                <p>{contaxt.para}</p>
                {/* <Tabular data={contaxt.tableData} /> */}
            </div>
        </div>
    )
}
export default Gallary
